import './App.css';
import IssueWrapper from './components/IssueWrapper';
import { Route, Routes } from 'react-router-dom';
import NavBar from './components/NavBar';

function App() {
  return (
    <>
      <NavBar/>
        <div className='container'>
      <Routes>
        <Route path="/" element={<IssueWrapper/>}/>
        {/* <Route path="/" element={<IssueWrapper/>}/> */}
      </Routes>
        </div>
    </>
  );
}

export default App;
